import React from "react";
import "./RoomPage.css";
import AfterNavbar from "../Navbar/AfterNavbar";

const RoomPage = () => {
  return (
    <div>
      <div className="room-container">
        <AfterNavbar />
        <div></div>
      </div>
    </div>
  );
};

export default RoomPage;
